INSERT INTO `posts` VALUES (1,1,1,'See has <a href=\"http://research.inplanb.com\">has_ancestor project page</a> for instructions on installation, documentation and road map.\n\nSee <a href=\"http://plans.inplanb.com/articles/2007/06/28/construct-model-abstractions-with-has_ancestor\">Construct Model Abstractions with has_ancestor</a> for a tutorial that implements a simple model.','2007-07-08 16:36:19','2007-09-27 00:53:51',1,'<p>See has <a href=\"http://research.inplanb.com\">has_ancestor project page</a> for instructions on installation, documentation and road map.</p>\n\n\n	<p>See <a href=\"http://plans.inplanb.com/articles/2007/06/28/construct-model-abstractions-with-has_ancestor\">Construct Model Abstractions with has_ancestor</a> for a tutorial that implements a simple model.</p>'),(2,1,2,'See has <a href=\"http://research.inplanb.com/has_ancestor\">has_ancestor</a> project page for instructions on installation and documentation.\n\nSee <a href=\"http://plans.inplanb.com/articles/2007/06/28/construct-model-abstractions-with-has_ancestor\">has_ancestor Model Abstractions</a> for a tutorial that implements a simple model.\n\nSee <a href=\"http://plans.inplanb.com/articles/2007/09/24/has_ancestor-finders\">has_ancestor finders</a> for a discussion using the new has_ancestor finders.','2007-09-27 00:52:15','2007-09-27 00:53:02',1,'<p>See has <a href=\"http://research.inplanb.com/has_ancestor\">has_ancestor</a> project page for instructions on installation and documentation.</p>\n\n\n	<p>See <a href=\"http://plans.inplanb.com/articles/2007/06/28/construct-model-abstractions-with-has_ancestor\">has_ancestor Model Abstractions</a> for a tutorial that implements a simple model.</p>\n\n\n	<p>See <a href=\"http://plans.inplanb.com/articles/2007/09/24/has_ancestor-finders\">has_ancestor finders</a> for a discussion using the new has_ancestor finders.</p>');
